{"id": "1174-recount", "word": "recount", "tweet1": {"text": "‚ÄúWe have no other option before us but to canvass, or certify, the recount.‚Äù", "tokens": ["‚Äú", "We", "have", "no", "other", "option", "before", "us", "but", "to", "canvass", ",", "or", "certify", ",", "the", "recount", ".", "‚Äù"], "token_idx": 16, "text_start": 67, "text_end": 74, "date": "2019-11"}, "tweet2": {"text": "DISTRICT 42: Prelim recount results are in. Democratic challenger Ed Cardillo Jr. adds two votes to his total and Frank Ricci loses one vote. Cardillo's lead stands at 3,512 to 3,399, and he looks to be the winner of the vacant @stephen_ucci seat.", "tokens": ["DISTRICT", "42", ":", "Prelim", "recount", "results", "are", "in", ".", "Democratic", "challenger", "Ed", "Cardillo", "Jr", ".", "adds", "two", "votes", "to", "his", "total", "and", "Frank", "Ricci", "loses", "one", "vote", ".", "Cardillo's", "lead", "stands", "at", "3,512", "to", "3,399", ",", "and", "he", "looks", "to", "be", "the", "winner", "of", "the", "vacant", "@stephen_ucci", "seat", "."], "token_idx": 4, "text_start": 20, "text_end": 27, "date": "2020-11"}}
{"id": "1175-recount", "word": "recount", "tweet1": {"text": "I'm a precinct judge with our county Board of Elections. We use paper ballots which are sent through a M100 (scantron like device) for counting. All of our ballots are preserved. If there's an issue, we go get the paper ballots and recount. Our counts are exact - every time.", "tokens": ["I'm", "a", "precinct", "judge", "with", "our", "county", "Board", "of", "Elections", ".", "We", "use", "paper", "ballots", "which", "are", "sent", "through", "a", "M100", "(", "scantron", "like", "device", ")", "for", "counting", ".", "All", "of", "our", "ballots", "are", "preserved", ".", "If", "there's", "an", "issue", ",", "we", "go", "get", "the", "paper", "ballots", "and", "recount", ".", "Our", "counts", "are", "exact", "-", "every", "time", "."], "token_idx": 48, "text_start": 232, "text_end": 239, "date": "2019-11"}, "tweet2": {"text": "So the Trump campaign paid $3 million for a recount in Milwaukee and Madison. The Milwaukee recount just concluded... and Joe Biden's lead *grew* by 132 votes, per @PostRoz.", "tokens": ["So", "the", "Trump", "campaign", "paid", "$", "3", "million", "for", "a", "recount", "in", "Milwaukee", "and", "Madison", ".", "The", "Milwaukee", "recount", "just", "concluded", "...", "and", "Joe", "Biden's", "lead", "*", "grew", "*", "by", "132", "votes", ",", "per", "@PostRoz", "."], "token_idx": 10, "text_start": 44, "text_end": 51, "date": "2020-11"}}
{"id": "1176-recount", "word": "recount", "tweet1": {"text": "Mrs B asked me last night what @mrjamesob's story was. I was able to recount his entire life, from birth &amp; adoption to schooling, early career in tailoring to the celeb pages, gaming, early work on TV, to his recent successes on LBC and HTBRIAWGW. I need to lay off the @LBC.", "tokens": ["Mrs", "B", "asked", "me", "last", "night", "what", "@mrjamesob", "'", "s", "story", "was", ".", "I", "was", "able", "to", "recount", "his", "entire", "life", ",", "from", "birth", "&", "adoption", "to", "schooling", ",", "early", "career", "in", "tailoring", "to", "the", "celeb", "pages", ",", "gaming", ",", "early", "work", "on", "TV", ",", "to", "his", "recent", "successes", "on", "LBC", "and", "HTBRIAWGW", ".", "I", "need", "to", "lay", "off", "the", "@LBC", "."], "token_idx": 17, "text_start": 69, "text_end": 76, "date": "2019-11"}, "tweet2": {"text": "Imagine having to recount millions of ballots by hand, during a pandemic, and you can't lick your thumb. Maddening! God bless those poll workers!!! #GeorgiaVotes #CountAllVotes", "tokens": ["Imagine", "having", "to", "recount", "millions", "of", "ballots", "by", "hand", ",", "during", "a", "pandemic", ",", "and", "you", "can't", "lick", "your", "thumb", ".", "Maddening", "!", "God", "bless", "those", "poll", "workers", "!", "!", "!", "#GeorgiaVotes", "#CountAllVotes"], "token_idx": 3, "text_start": 18, "text_end": 25, "date": "2020-11"}}
